import { StyleSheet, Text, View, Image } from 'react-native'
import React from 'react'
import MainHeader from '../Components/MainHeader';
import { TouchableOpacity } from 'react-native-web';
import footballBackground from "../assets/footballBackground.png"
import tennisBackground from '../assets/tennisBackground.png'
import basketballBackground from '../assets/basketballBackground.png'


export default function Home() {
  return (
    <View style={styles.container}>
      <MainHeader title={"Choose Your Booking Club"} />
      <View style={styles.football}>
        <TouchableOpacity>
          <Image source={footballBackground} style={styles.footballStyle} />
        </TouchableOpacity>
      </View>
      <View style={styles.tennis}>
        <TouchableOpacity>
          <Image source={tennisBackground} style={styles.tennisStyle} />
        </TouchableOpacity>
      </View>
      <View style={styles.basketball}></View>
      <TouchableOpacity>
        <Image source={basketballBackground} style={styles.basketballStyle} />
      </TouchableOpacity>
      </View>

  );
}

const styles = StyleSheet.create({
  container: {

  },
  footballStyle: {

  },
  tennisStyle: {

  },
  basketballStyle: {

  }
})
